import { AppContext } from "../appProvider"



function RecallList() {

    const contextItems = React.useContext(AppContext)

    const list = contextItems.recalls.map(thing => <div key={thing.event._id}>

            <h2>{thing.city}</h2>
            <br></br>
            {thing.country}



            </div>
        )

    return (
        <>
            <div className="mainArea">
                <h3>I'm a recall list</h3>
                {console.log(contextItems.recalls[1])}
                {list}
            </div>
        </>
    )
}



export default RecallList
